import { Route, Switch, Redirect } from "react-router-dom";
import Jokes from "./pages/Jokes";
import AddJoke from "./pages/AddJoke";
import JokeDetails from "./pages/JokeDetails";

function App() {
  return (
    <Switch>
      <Redirect to="/jokes" />
      <Route path="/jokes" exact>
        <Jokes />
      </Route>
      <Route path="/jokes/:jokeId">
        <JokeDetails />
      </Route>
      <Route path="/add-joke">
        <AddJoke />
      </Route>
    </Switch>
  );
}

export default App;
